INSERT INTO `course_module_contents` (`id`, `course_module_id`, `title`, `content`, `content_type_id`, `content_number`, `created_at`, `updated_at`) VALUES
(1, 1, 'What is Algebra?', '<h2 class=\"\" data-start=\"100\" data-end=\"133\"><strong data-start=\"103\" data-end=\"133\">Module 1: What is Algebra?</strong></h2>\n<h3 class=\"\" data-start=\"135\" data-end=\"155\"><strong data-start=\"139\" data-end=\"153\">Objective:</strong></h3>\n<p class=\"\" data-start=\"156\" data-end=\"297\">By the end of this module, you will understand what algebra is, why it&rsquo;s useful, and how it&rsquo;s used in everyday life and other areas of study.</p>\n<hr class=\"\" data-start=\"299\" data-end=\"302\">\n<h3 class=\"\" data-start=\"304\" data-end=\"330\"><strong data-start=\"308\" data-end=\"328\">What is Algebra?</strong></h3>\n<p class=\"\" data-start=\"331\" data-end=\"566\">Algebra is a branch of mathematics that uses <strong data-start=\"376\" data-end=\"387\">symbols</strong> (usually letters like <em data-start=\"410\" data-end=\"413\">x</em>, <em data-start=\"415\" data-end=\"418\">y</em>, or <em data-start=\"423\" data-end=\"426\">a</em>) to represent <strong data-start=\"441\" data-end=\"459\">unknown values</strong> or <strong data-start=\"463\" data-end=\"476\">variables</strong>. These symbols help us write mathematical rules, solve problems, and understand patterns.</p>\n<p class=\"\" data-start=\"568\" data-end=\"685\">Rather than only working with specific numbers, algebra lets us generalize and solve problems in a more flexible way.</p>\n<h4 class=\"\" data-start=\"687\" data-end=\"702\">Example:</h4>\n<p class=\"\" data-start=\"703\" data-end=\"786\">Instead of saying:<br data-start=\"721\" data-end=\"724\">\"If I have 3 apples and I buy 2 more, I will have 5 apples.\"</p>\n<p class=\"\" data-start=\"788\" data-end=\"868\">We say:<br data-start=\"795\" data-end=\"798\">\"If I have <em data-start=\"809\" data-end=\"812\">x</em> apples and I buy 2 more, I will have <em data-start=\"850\" data-end=\"857\">x + 2</em> apples.\"</p>\n<p class=\"\" data-start=\"870\" data-end=\"943\">This can now apply to any number of apples &mdash; that\'s the power of algebra.</p>\n<hr class=\"\" data-start=\"945\" data-end=\"948\">\n<h3 class=\"\" data-start=\"950\" data-end=\"978\"><strong data-start=\"954\" data-end=\"976\">Why Learn Algebra?</strong></h3>\n<p class=\"\" data-start=\"979\" data-end=\"1043\">Algebra is the language of modern problem solving. It helps you:</p>\n<ul data-start=\"1045\" data-end=\"1346\">\n<li class=\"\" data-start=\"1045\" data-end=\"1127\">\n<p class=\"\" data-start=\"1047\" data-end=\"1127\">Solve real-world problems like budgeting or distance-travel-time relationships</p>\n</li>\n<li class=\"\" data-start=\"1128\" data-end=\"1177\">\n<p class=\"\" data-start=\"1130\" data-end=\"1177\">Develop logical thinking and reasoning skills</p>\n</li>\n<li class=\"\" data-start=\"1178\" data-end=\"1259\">\n<p class=\"\" data-start=\"1180\" data-end=\"1259\">Understand science and data (physics, chemistry, economics, statistics, etc.)</p>\n</li>\n<li class=\"\" data-start=\"1260\" data-end=\"1346\">\n<p class=\"\" data-start=\"1262\" data-end=\"1346\">Build a foundation for careers in engineering, computer science, finance, and more</p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"1348\" data-end=\"1351\">\n<h3 class=\"\" data-start=\"1353\" data-end=\"1393\"><strong data-start=\"1357\" data-end=\"1393\">Key Terms Introduced in Algebra:&nbsp;</strong></h3>\n<div class=\"_tableContainer_16hzy_1\">\n<div class=\"_tableWrapper_16hzy_14 group flex w-fit flex-col-reverse\" tabindex=\"-1\">\n<table class=\"w-fit min-w-(--thread-content-width)\" data-start=\"1395\" data-end=\"1903\">\n<thead data-start=\"1395\" data-end=\"1476\">\n<tr data-start=\"1395\" data-end=\"1476\">\n<th data-start=\"1395\" data-end=\"1410\" data-col-size=\"sm\">Term</th>\n<th data-start=\"1410\" data-end=\"1461\" data-col-size=\"md\">Definition</th>\n<th data-start=\"1461\" data-end=\"1476\" data-col-size=\"sm\">Example</th>\n</tr>\n</thead>\n<tbody data-start=\"1559\" data-end=\"1903\">\n<tr data-start=\"1559\" data-end=\"1644\">\n<td data-start=\"1559\" data-end=\"1574\" data-col-size=\"sm\"><strong data-start=\"1561\" data-end=\"1573\">Variable</strong></td>\n<td data-start=\"1574\" data-end=\"1627\" data-col-size=\"md\">A symbol (often a letter) that represents a number</td>\n<td data-start=\"1627\" data-end=\"1644\" data-col-size=\"sm\"><code data-start=\"1629\" data-end=\"1632\">x</code>, <code data-start=\"1634\" data-end=\"1637\">y</code>, <code data-start=\"1639\" data-end=\"1642\">a</code></td>\n</tr>\n<tr data-start=\"1645\" data-end=\"1732\">\n<td data-start=\"1645\" data-end=\"1660\" data-col-size=\"sm\"><strong data-start=\"1647\" data-end=\"1659\">Constant</strong></td>\n<td data-start=\"1660\" data-end=\"1711\" data-col-size=\"md\">A fixed value</td>\n<td data-start=\"1711\" data-end=\"1732\" data-col-size=\"sm\"><code data-start=\"1713\" data-end=\"1716\">5</code>, <code data-start=\"1718\" data-end=\"1722\">-2</code>, <code data-start=\"1724\" data-end=\"1730\">3.14</code></td>\n</tr>\n<tr data-start=\"1733\" data-end=\"1820\">\n<td data-start=\"1733\" data-end=\"1750\" data-col-size=\"sm\"><strong data-start=\"1735\" data-end=\"1749\">Expression</strong></td>\n<td data-start=\"1750\" data-end=\"1806\" data-col-size=\"md\">A combination of variables, constants, and operations</td>\n<td data-start=\"1806\" data-end=\"1820\" data-col-size=\"sm\"><code data-start=\"1808\" data-end=\"1816\">2x + 3</code></td>\n</tr>\n<tr data-start=\"1821\" data-end=\"1903\">\n<td data-start=\"1821\" data-end=\"1836\" data-col-size=\"sm\"><strong data-start=\"1823\" data-end=\"1835\">Equation</strong></td>\n<td data-start=\"1836\" data-end=\"1887\" data-col-size=\"md\">A statement showing two expressions are equal</td>\n<td data-start=\"1887\" data-end=\"1903\" data-col-size=\"sm\"><code data-start=\"1889\" data-end=\"1901\">2x + 3 = 7</code></td>\n</tr>\n</tbody>\n</table>\n<div class=\"sticky end-(--thread-content-margin) h-0 self-end select-none\">\n<div class=\"absolute end-0 flex items-end\">&nbsp;</div>\n</div>\n</div>\n</div>\n<hr class=\"\" data-start=\"1905\" data-end=\"1908\">\n<h3 class=\"\" data-start=\"1910\" data-end=\"1951\"><strong data-start=\"1914\" data-end=\"1951\">Real-Life Applications of Algebra</strong></h3>\n<ul data-start=\"1952\" data-end=\"2168\">\n<li class=\"\" data-start=\"1952\" data-end=\"2015\">\n<p class=\"\" data-start=\"1954\" data-end=\"2015\">Planning your monthly budget: <code data-start=\"1984\" data-end=\"2013\">Income - Expenses = Savings</code></p>\n</li>\n<li class=\"\" data-start=\"2016\" data-end=\"2084\">\n<p class=\"\" data-start=\"2018\" data-end=\"2084\">Figuring out how long a trip will take: <code data-start=\"2058\" data-end=\"2082\">Distance = Rate &times; Time</code></p>\n</li>\n<li class=\"\" data-start=\"2085\" data-end=\"2168\">\n<p class=\"\" data-start=\"2087\" data-end=\"2168\">Understanding phone/data plans: <code data-start=\"2119\" data-end=\"2168\">Total Cost = Base Fee + (Cost per GB &times; GB Used)</code></p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"2170\" data-end=\"2173\">\n<h3 class=\"\" data-start=\"2175\" data-end=\"2202\"><strong data-start=\"2179\" data-end=\"2202\">Mini Quiz (Try It!)</strong></h3>\n<p class=\"\" data-start=\"2204\" data-end=\"2289\"><strong data-start=\"2204\" data-end=\"2248\">1. Which of the following is a variable?</strong><br data-start=\"2248\" data-end=\"2251\">a) 5&emsp;b) x&emsp;c) +&emsp;d) =<br data-start=\"2270\" data-end=\"2273\">Answer: <strong data-start=\"2281\" data-end=\"2289\">b) x</strong></p>\n<p class=\"\" data-start=\"2291\" data-end=\"2399\"><strong data-start=\"2291\" data-end=\"2340\">2. Which of these is an algebraic expression?</strong><br data-start=\"2340\" data-end=\"2343\">a) 3 + 2&emsp;b) x = 4&emsp;c) 2x + 1&emsp;d) 7<br data-start=\"2375\" data-end=\"2378\">Answer: <strong data-start=\"2386\" data-end=\"2399\">c) 2x + 1&nbsp;</strong></p>\n<hr class=\"\" data-start=\"2401\" data-end=\"2404\">\n<h3 class=\"\" data-start=\"2406\" data-end=\"2423\"><strong data-start=\"2410\" data-end=\"2421\">Summary</strong></h3>\n<p class=\"\" data-start=\"2424\" data-end=\"2660\">Algebra is a powerful mathematical tool that helps us describe and solve problems using symbols and logical thinking. In the next lesson, we&rsquo;ll dive deeper into <strong data-start=\"2585\" data-end=\"2626\">variables, constants, and expressions</strong> &mdash; the building blocks of algebra.</p>\n<p class=\"\" data-start=\"2424\" data-end=\"2660\">&nbsp;</p>\n<h1 data-start=\"2424\" data-end=\"2660\">Test</h1>\n<table style=\"border-collapse: collapse; width: 100.031%;\" border=\"1\"><colgroup><col style=\"width: 2.62136%;\"><col style=\"width: 2.62136%;\"><col style=\"width: 2.62136%;\"><col style=\"width: 2.62136%;\"><col style=\"width: 2.62136%;\"><col style=\"width: 2.62136%;\"></colgroup>\n<tbody>\n<tr>\n<td>Item&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;ad</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', 1, 1, '2025-05-18 06:34:15', '2025-05-18 16:22:26'),
(2, 1, 'Variables, Constants, and Expressions', '<h2 class=\"\" data-start=\"136\" data-end=\"199\"><strong data-start=\"139\" data-end=\"199\">Module 1 &ndash; Part 2: Variables, Constants, and Expressions</strong></h2>\n<h3 class=\"\" data-start=\"201\" data-end=\"221\"><strong data-start=\"205\" data-end=\"219\">Objective:</strong></h3>\n<p class=\"\" data-start=\"222\" data-end=\"370\">Understand the basic building blocks of algebraic language: variables, constants, and expressions. Learn how to identify and work with each of them.</p>\n<hr class=\"\" data-start=\"372\" data-end=\"375\">\n<h3 class=\"\" data-start=\"377\" data-end=\"409\"><strong data-start=\"381\" data-end=\"407\">1. What Are Variables?</strong></h3>\n<p class=\"\" data-start=\"410\" data-end=\"625\">A <strong data-start=\"412\" data-end=\"424\">variable</strong> is a symbol (typically a letter like <em data-start=\"462\" data-end=\"465\">x</em>, <em data-start=\"467\" data-end=\"470\">y</em>, or <em data-start=\"475\" data-end=\"478\">n</em>) that represents an unknown or changeable value. Variables allow us to generalize problems and create formulas that work for different situations.</p>\n<p class=\"\" data-start=\"627\" data-end=\"642\"><strong data-start=\"627\" data-end=\"640\">Examples:</strong></p>\n<ul data-start=\"643\" data-end=\"744\">\n<li class=\"\" data-start=\"643\" data-end=\"694\">\n<p class=\"\" data-start=\"645\" data-end=\"694\">In the expression <code data-start=\"663\" data-end=\"670\">x + 5</code>, the variable is <code data-start=\"688\" data-end=\"691\">x</code>.</p>\n</li>\n<li class=\"\" data-start=\"695\" data-end=\"744\">\n<p class=\"\" data-start=\"697\" data-end=\"744\">In the equation <code data-start=\"713\" data-end=\"722\">2n = 10</code>, the variable is <code data-start=\"740\" data-end=\"743\">n</code>.</p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"746\" data-end=\"749\">\n<h3 class=\"\" data-start=\"751\" data-end=\"783\"><strong data-start=\"755\" data-end=\"781\">2. What Are Constants?</strong></h3>\n<p class=\"\" data-start=\"784\" data-end=\"880\">A <strong data-start=\"786\" data-end=\"798\">constant</strong> is a fixed value that does not change. In algebra, constants are usually numbers.</p>\n<p class=\"\" data-start=\"882\" data-end=\"897\"><strong data-start=\"882\" data-end=\"895\">Examples:</strong></p>\n<ul data-start=\"898\" data-end=\"1039\">\n<li class=\"\" data-start=\"898\" data-end=\"943\">\n<p class=\"\" data-start=\"900\" data-end=\"943\">In <code data-start=\"903\" data-end=\"910\">x + 5</code>, the number <code data-start=\"923\" data-end=\"926\">5</code> is a constant.</p>\n</li>\n<li class=\"\" data-start=\"944\" data-end=\"1039\">\n<p class=\"\" data-start=\"946\" data-end=\"1039\">In <code data-start=\"949\" data-end=\"957\">3y - 7</code>, both <code data-start=\"964\" data-end=\"967\">3</code> and <code data-start=\"972\" data-end=\"975\">7</code> are constants (note that <code data-start=\"1001\" data-end=\"1004\">3</code> is a constant coefficient of <code data-start=\"1034\" data-end=\"1037\">y</code>).</p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"1041\" data-end=\"1044\">\n<h3 class=\"\" data-start=\"1046\" data-end=\"1080\"><strong data-start=\"1050\" data-end=\"1078\">3. What Are Expressions?</strong></h3>\n<p class=\"\" data-start=\"1081\" data-end=\"1274\">An <strong data-start=\"1084\" data-end=\"1098\">expression</strong> is a mathematical phrase that includes variables, constants, and operations (such as addition, subtraction, multiplication, or division), but <strong data-start=\"1241\" data-end=\"1273\">does not have an equals sign</strong>.</p>\n<p class=\"\" data-start=\"1276\" data-end=\"1291\"><strong data-start=\"1276\" data-end=\"1289\">Examples:</strong></p>\n<ul data-start=\"1292\" data-end=\"1356\">\n<li class=\"\" data-start=\"1292\" data-end=\"1322\">\n<p class=\"\" data-start=\"1294\" data-end=\"1322\"><code data-start=\"1294\" data-end=\"1302\">2x + 3</code> is an expression.</p>\n</li>\n<li class=\"\" data-start=\"1323\" data-end=\"1356\">\n<p class=\"\" data-start=\"1325\" data-end=\"1356\"><code data-start=\"1325\" data-end=\"1333\">5a - 7</code> is another expression.</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"1358\" data-end=\"1442\">Expressions can be simplified, but not \"solved\" unless they are part of an equation.</p>\n<hr class=\"\" data-start=\"1444\" data-end=\"1447\">\n<h3 class=\"\" data-start=\"1449\" data-end=\"1496\"><strong data-start=\"1453\" data-end=\"1494\">4. Identifying Parts of an Expression</strong></h3>\n<p class=\"\" data-start=\"1497\" data-end=\"1539\">Let\'s break down this expression: <code data-start=\"1531\" data-end=\"1539\">4x + 9</code></p>\n<ul data-start=\"1541\" data-end=\"1714\">\n<li class=\"\" data-start=\"1541\" data-end=\"1607\">\n<p class=\"\" data-start=\"1543\" data-end=\"1607\"><code data-start=\"1543\" data-end=\"1546\">4</code> is the <strong data-start=\"1554\" data-end=\"1569\">coefficient</strong> (a number multiplying the variable)</p>\n</li>\n<li class=\"\" data-start=\"1608\" data-end=\"1635\">\n<p class=\"\" data-start=\"1610\" data-end=\"1635\"><code data-start=\"1610\" data-end=\"1613\">x</code> is the <strong data-start=\"1621\" data-end=\"1633\">variable</strong></p>\n</li>\n<li class=\"\" data-start=\"1636\" data-end=\"1663\">\n<p class=\"\" data-start=\"1638\" data-end=\"1663\"><code data-start=\"1638\" data-end=\"1641\">9</code> is the <strong data-start=\"1649\" data-end=\"1661\">constant</strong></p>\n</li>\n<li class=\"\" data-start=\"1664\" data-end=\"1714\">\n<p class=\"\" data-start=\"1666\" data-end=\"1714\">The entire phrase is an <strong data-start=\"1690\" data-end=\"1714\">algebraic expression</strong></p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"1716\" data-end=\"1719\">\n<h3 class=\"\" data-start=\"1721\" data-end=\"1757\"><strong data-start=\"1725\" data-end=\"1755\">5. Simplifying Expressions</strong></h3>\n<p class=\"\" data-start=\"1758\" data-end=\"1864\">Simplifying means combining like terms and using math properties to rewrite expressions in a simpler form.</p>\n<p class=\"\" data-start=\"1866\" data-end=\"1962\"><strong data-start=\"1866\" data-end=\"1878\">Example:</strong><br data-start=\"1878\" data-end=\"1881\">Simplify <code data-start=\"1890\" data-end=\"1907\">3x + 4 + 2x + 1</code><br data-start=\"1907\" data-end=\"1910\">Combine like terms:<br data-start=\"1929\" data-end=\"1932\"><code data-start=\"1932\" data-end=\"1962\">(3x + 2x) + (4 + 1) = 5x + 5</code></p>\n<hr class=\"\" data-start=\"1964\" data-end=\"1967\">\n<h3 class=\"\" data-start=\"1969\" data-end=\"1997\"><strong data-start=\"1973\" data-end=\"1995\">Practice Questions</strong></h3>\n<p class=\"\" data-start=\"1998\" data-end=\"2083\"><strong data-start=\"1998\" data-end=\"2072\">1. Identify the variable, constant, and coefficient in the expression:</strong> <code data-start=\"2073\" data-end=\"2081\">7y - 2</code></p>\n<ul data-start=\"2084\" data-end=\"2149\">\n<li class=\"\" data-start=\"2084\" data-end=\"2104\">\n<p class=\"\" data-start=\"2086\" data-end=\"2104\">Variable: ______</p>\n</li>\n<li class=\"\" data-start=\"2105\" data-end=\"2128\">\n<p class=\"\" data-start=\"2107\" data-end=\"2128\">Coefficient: ______</p>\n</li>\n<li class=\"\" data-start=\"2129\" data-end=\"2149\">\n<p class=\"\" data-start=\"2131\" data-end=\"2149\">Constant: ______</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"2151\" data-end=\"2230\"><strong data-start=\"2151\" data-end=\"2182\">2. Simplify the expression:</strong> <code data-start=\"2183\" data-end=\"2200\">6a + 3 + 2a - 1</code><br data-start=\"2200\" data-end=\"2203\">Answer: ___________________</p>\n<hr class=\"\" data-start=\"2232\" data-end=\"2235\">\n<h3 class=\"\" data-start=\"2237\" data-end=\"2254\"><strong data-start=\"2241\" data-end=\"2252\">Summary&nbsp;</strong></h3>\n<ul data-start=\"2255\" data-end=\"2496\">\n<li class=\"\" data-start=\"2255\" data-end=\"2311\">\n<p class=\"\" data-start=\"2257\" data-end=\"2311\">A <strong data-start=\"2259\" data-end=\"2271\">variable</strong> represents unknown or changing values</p>\n</li>\n<li class=\"\" data-start=\"2312\" data-end=\"2348\">\n<p class=\"\" data-start=\"2314\" data-end=\"2348\">A <strong data-start=\"2316\" data-end=\"2328\">constant</strong> is a fixed number</p>\n</li>\n<li class=\"\" data-start=\"2349\" data-end=\"2439\">\n<p class=\"\" data-start=\"2351\" data-end=\"2439\">An <strong data-start=\"2354\" data-end=\"2368\">expression</strong> combines variables, constants, and operations without an equals sign</p>\n</li>\n<li class=\"\" data-start=\"2440\" data-end=\"2496\">\n<p class=\"\" data-start=\"2442\" data-end=\"2496\">You can simplify expressions by combining like terms</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"2498\" data-end=\"2598\">In the next part, we will explore how to translate real-world situations into algebraic expressions.</p>', 1, 2, '2025-05-18 06:34:15', '2025-05-18 06:44:59'),
(3, 1, 'Real-Life Problems', '<h2 class=\"\" data-start=\"106\" data-end=\"189\"><strong data-start=\"109\" data-end=\"189\">Module 1 &ndash; Part 3: Translating Real-Life Problems into Algebraic Expressions</strong></h2>\n<h3 class=\"\" data-start=\"191\" data-end=\"211\"><strong data-start=\"195\" data-end=\"209\">Objective:</strong></h3>\n<p class=\"\" data-start=\"212\" data-end=\"348\">Learn how to translate everyday situations into algebraic expressions. This skill allows you to solve real-world problems using algebra.</p>\n<hr class=\"\" data-start=\"350\" data-end=\"353\">\n<h3 class=\"\" data-start=\"355\" data-end=\"406\"><strong data-start=\"359\" data-end=\"404\">1. What Does Translating Mean in Algebra?</strong></h3>\n<p class=\"\" data-start=\"407\" data-end=\"613\">Translating in algebra refers to taking a word problem or real-life scenario and writing it as an algebraic expression or equation. In other words, we convert a verbal description into mathematical symbols.</p>\n<hr class=\"\" data-start=\"615\" data-end=\"618\">\n<h3 class=\"\" data-start=\"620\" data-end=\"669\"><strong data-start=\"624\" data-end=\"669\">2. Key Terms to Look for in Word Problems</strong></h3>\n<ul data-start=\"670\" data-end=\"1015\">\n<li class=\"\" data-start=\"670\" data-end=\"772\">\n<p class=\"\" data-start=\"672\" data-end=\"772\"><strong data-start=\"672\" data-end=\"694\">Total/Amount/Value</strong>: These words often indicate a sum or result, suggesting addition or equality.</p>\n</li>\n<li class=\"\" data-start=\"773\" data-end=\"817\">\n<p class=\"\" data-start=\"775\" data-end=\"817\"><strong data-start=\"775\" data-end=\"789\">Difference</strong>: This suggests subtraction.</p>\n</li>\n<li class=\"\" data-start=\"818\" data-end=\"883\">\n<p class=\"\" data-start=\"820\" data-end=\"883\"><strong data-start=\"820\" data-end=\"838\">Times/Per/Each</strong>: These words usually suggest multiplication.</p>\n</li>\n<li class=\"\" data-start=\"884\" data-end=\"938\">\n<p class=\"\" data-start=\"886\" data-end=\"938\"><strong data-start=\"886\" data-end=\"907\">Divided by/Out of</strong>: These words suggest division.</p>\n</li>\n<li class=\"\" data-start=\"939\" data-end=\"974\">\n<p class=\"\" data-start=\"941\" data-end=\"974\"><strong data-start=\"941\" data-end=\"954\">More Than</strong>: This means to add.</p>\n</li>\n<li class=\"\" data-start=\"975\" data-end=\"1015\">\n<p class=\"\" data-start=\"977\" data-end=\"1015\"><strong data-start=\"977\" data-end=\"990\">Less Than</strong>: This means to subtract.</p>\n</li>\n</ul>\n<hr class=\"\" data-start=\"1017\" data-end=\"1020\">\n<h3 class=\"\" data-start=\"1022\" data-end=\"1065\"><strong data-start=\"1026\" data-end=\"1065\">3. Translating Simple Word Problems</strong></h3>\n<h4 class=\"\" data-start=\"1067\" data-end=\"1106\"><strong data-start=\"1072\" data-end=\"1104\">Example 1: Adding Quantities</strong></h4>\n<p class=\"\" data-start=\"1107\" data-end=\"1200\"><strong data-start=\"1107\" data-end=\"1119\">Problem:</strong> Sarah has 5 apples. She buys 3 more apples. How many apples does she have now?</p>\n<p class=\"\" data-start=\"1202\" data-end=\"1220\"><strong data-start=\"1202\" data-end=\"1218\">Translation:</strong></p>\n<ul data-start=\"1221\" data-end=\"1289\">\n<li class=\"\" data-start=\"1221\" data-end=\"1242\">\n<p class=\"\" data-start=\"1223\" data-end=\"1242\">Sarah&rsquo;s apples: 5</p>\n</li>\n<li class=\"\" data-start=\"1243\" data-end=\"1265\">\n<p class=\"\" data-start=\"1245\" data-end=\"1265\">Apples she buys: 3</p>\n</li>\n<li class=\"\" data-start=\"1266\" data-end=\"1289\">\n<p class=\"\" data-start=\"1268\" data-end=\"1289\">Total apples: 5 + 3</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"1291\" data-end=\"1382\"><strong data-start=\"1291\" data-end=\"1316\">Algebraic Expression:</strong><br data-start=\"1316\" data-end=\"1319\"><code data-start=\"1319\" data-end=\"1326\">5 + 3</code><br data-start=\"1326\" data-end=\"1329\">This represents the total number of apples Sarah has.</p>\n<h4 class=\"\" data-start=\"1384\" data-end=\"1428\"><strong data-start=\"1389\" data-end=\"1426\">Example 2: Subtracting Quantities</strong></h4>\n<p class=\"\" data-start=\"1429\" data-end=\"1549\"><strong data-start=\"1429\" data-end=\"1441\">Problem:</strong> A store sells a shirt for $20. If you have $50, how much money will you have left after buying the shirt?</p>\n<p class=\"\" data-start=\"1551\" data-end=\"1569\"><strong data-start=\"1551\" data-end=\"1567\">Translation:</strong></p>\n<ul data-start=\"1570\" data-end=\"1642\">\n<li class=\"\" data-start=\"1570\" data-end=\"1592\">\n<p class=\"\" data-start=\"1572\" data-end=\"1592\">Money you have: 50</p>\n</li>\n<li class=\"\" data-start=\"1593\" data-end=\"1618\">\n<p class=\"\" data-start=\"1595\" data-end=\"1618\">Cost of the shirt: 20</p>\n</li>\n<li class=\"\" data-start=\"1619\" data-end=\"1642\">\n<p class=\"\" data-start=\"1621\" data-end=\"1642\">Money left: 50 - 20</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"1644\" data-end=\"1752\"><strong data-start=\"1644\" data-end=\"1669\">Algebraic Expression:</strong><br data-start=\"1669\" data-end=\"1672\"><code data-start=\"1672\" data-end=\"1681\">50 - 20</code><br data-start=\"1681\" data-end=\"1684\">This represents the amount of money left after purchasing the shirt.</p>\n<h4 class=\"\" data-start=\"1754\" data-end=\"1798\"><strong data-start=\"1759\" data-end=\"1796\">Example 3: Multiplying Quantities</strong></h4>\n<p class=\"\" data-start=\"1799\" data-end=\"1909\"><strong data-start=\"1799\" data-end=\"1811\">Problem:</strong> If you are paid $15 per hour for babysitting, how much will you earn after working for 6 hours?</p>\n<p class=\"\" data-start=\"1911\" data-end=\"1929\"><strong data-start=\"1911\" data-end=\"1927\">Translation:</strong></p>\n<ul data-start=\"1930\" data-end=\"1999\">\n<li class=\"\" data-start=\"1930\" data-end=\"1949\">\n<p class=\"\" data-start=\"1932\" data-end=\"1949\">Hourly wage: 15</p>\n</li>\n<li class=\"\" data-start=\"1950\" data-end=\"1972\">\n<p class=\"\" data-start=\"1952\" data-end=\"1972\">Number of hours: 6</p>\n</li>\n<li class=\"\" data-start=\"1973\" data-end=\"1999\">\n<p class=\"\" data-start=\"1975\" data-end=\"1999\">Total earnings: 15 &times; 6</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"2001\" data-end=\"2101\"><strong data-start=\"2001\" data-end=\"2026\">Algebraic Expression:</strong><br data-start=\"2026\" data-end=\"2029\"><code data-start=\"2029\" data-end=\"2037\">15 * 6</code><br data-start=\"2037\" data-end=\"2040\">This represents the total earnings after working for 6 hours.</p>\n<h4 class=\"\" data-start=\"2103\" data-end=\"2144\"><strong data-start=\"2108\" data-end=\"2142\">Example 4: Dividing Quantities</strong></h4>\n<p class=\"\" data-start=\"2145\" data-end=\"2292\"><strong data-start=\"2145\" data-end=\"2157\">Problem:</strong> A pizza is cut into 8 equal slices. If you have 3 friends and want to share the pizza equally, how many slices does each person get?</p>\n<p class=\"\" data-start=\"2294\" data-end=\"2312\"><strong data-start=\"2294\" data-end=\"2310\">Translation:</strong></p>\n<ul data-start=\"2313\" data-end=\"2401\">\n<li class=\"\" data-start=\"2313\" data-end=\"2332\">\n<p class=\"\" data-start=\"2315\" data-end=\"2332\">Total slices: 8</p>\n</li>\n<li class=\"\" data-start=\"2333\" data-end=\"2372\">\n<p class=\"\" data-start=\"2335\" data-end=\"2372\">Number of people (including you): 4</p>\n</li>\n<li class=\"\" data-start=\"2373\" data-end=\"2401\">\n<p class=\"\" data-start=\"2375\" data-end=\"2401\">Slices per person: 8 &divide; 4</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"2403\" data-end=\"2495\"><strong data-start=\"2403\" data-end=\"2428\">Algebraic Expression:</strong><br data-start=\"2428\" data-end=\"2431\"><code data-start=\"2431\" data-end=\"2438\">8 / 4</code><br data-start=\"2438\" data-end=\"2441\">This represents the number of slices each person gets.</p>\n<hr class=\"\" data-start=\"2497\" data-end=\"2500\">\n<h3 class=\"\" data-start=\"2502\" data-end=\"2532\"><strong data-start=\"2506\" data-end=\"2530\">4. Practice Problems</strong></h3>\n<p class=\"\" data-start=\"2533\" data-end=\"2710\"><strong data-start=\"2533\" data-end=\"2606\">1. Translate the following word problem into an algebraic expression:</strong><br data-start=\"2606\" data-end=\"2609\">\"A box of chocolates contains 12 pieces. You give away 4 pieces. How many pieces do you have left?\"</p>\n<p class=\"\" data-start=\"2712\" data-end=\"2739\"><strong data-start=\"2712\" data-end=\"2737\">Algebraic Expression:</strong></p>\n<hr class=\"\" data-start=\"2740\" data-end=\"2752\">\n<p class=\"\" data-start=\"2754\" data-end=\"2916\"><strong data-start=\"2754\" data-end=\"2827\">2. Translate the following word problem into an algebraic expression:</strong><br data-start=\"2827\" data-end=\"2830\">\"John earns $10 for every book he sells. How much does he earn for selling 7 books?\"</p>\n<p class=\"\" data-start=\"2918\" data-end=\"2945\"><strong data-start=\"2918\" data-end=\"2943\">Algebraic Expression:</strong></p>\n<hr class=\"\" data-start=\"2946\" data-end=\"2956\"><hr class=\"\" data-start=\"2958\" data-end=\"2961\">\n<h3 class=\"\" data-start=\"2963\" data-end=\"3003\"><strong data-start=\"2967\" data-end=\"3003\">5. Real-Life Application Example</strong></h3>\n<p class=\"\" data-start=\"3005\" data-end=\"3193\">Let&rsquo;s apply algebra to a real-world problem:<br><strong data-start=\"3050\" data-end=\"3062\">Problem:</strong> You are hosting a party and need to buy snacks. You buy 3 bags of chips, each costing $4. How much do you spend on chips in total?</p>\n<p class=\"\" data-start=\"3195\" data-end=\"3213\"><strong data-start=\"3195\" data-end=\"3211\">Translation:</strong></p>\n<ul data-start=\"3214\" data-end=\"3290\">\n<li class=\"\" data-start=\"3214\" data-end=\"3246\">\n<p class=\"\" data-start=\"3216\" data-end=\"3246\">Price of one bag of chips: 4</p>\n</li>\n<li class=\"\" data-start=\"3247\" data-end=\"3268\">\n<p class=\"\" data-start=\"3249\" data-end=\"3268\">Number of bags: 3</p>\n</li>\n<li class=\"\" data-start=\"3269\" data-end=\"3290\">\n<p class=\"\" data-start=\"3271\" data-end=\"3290\">Total cost: 4 * 3</p>\n</li>\n</ul>\n<p class=\"\" data-start=\"3292\" data-end=\"3379\"><strong data-start=\"3292\" data-end=\"3317\">Algebraic Expression:</strong><br data-start=\"3317\" data-end=\"3320\"><code data-start=\"3320\" data-end=\"3332\">4 * 3 = 12</code><br data-start=\"3332\" data-end=\"3335\">This represents the total cost of the chips.&nbsp;</p>\n<hr class=\"\" data-start=\"3381\" data-end=\"3384\">\n<h3 class=\"\" data-start=\"3386\" data-end=\"3401\"><strong data-start=\"3390\" data-end=\"3401\">Summary</strong></h3>\n<p class=\"\" data-start=\"3402\" data-end=\"3699\">Translating real-life situations into algebraic expressions is an essential skill that allows you to solve practical problems. Key steps include identifying quantities, understanding operations (addition, subtraction, multiplication, and division), and using variables to represent unknown values.</p>\n<p class=\"\" data-start=\"3701\" data-end=\"3783\">In the next module, we will begin learning how to solve basic algebraic equations!</p>', 1, 3, '2025-05-18 06:34:15', '2025-05-18 06:45:36'),
